import React from "react";

export default class JugadoresPagina extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            Jugador: []
   }
    }
    componentDidMount() {

        fetch("https://api.football-data.org/v2/teams/86/players", {

            method: "GET",
            headers: {
                "X-Auth-Token": "130849e0ce064febb45c9991f11c78a6"
            },
        })

            .then((res) => res.json())
            .then((data) => {
                this.setState({
                    Jugador: data
                })
            }
            )            

            .catch((err) => console.log(err))
    }


    render() {



    }
}
